import React, { Component } from 'react'

export class Quote extends Component {
  constructor(props){
    super(props);

  }

  render() {
    return (
      <div>
        <div id='text'>{this.props.quote.text}</div>
        <div id='author'>{this.props.quote.author}</div>

      </div>
    )
  }
}

export default Quote
